@MaiasMind_ This is about being forced to speak.. People may be donating to BLM movement, families of victims, shared posts, signed petitions..

But I do not think anybody should be forced to ‘speak’ If they do not have the capacity.

Otherwise it becomes disingenuous and performative.

@MaiasMind_ I don’t speak or even care for those who aren’t speaking because they don’t care. Fuck them.

I am talking for those who can’t take or speak on watching people getting executed! 

Peoples capacity to deal with these things are all different!

@MaiasMind_ Disagree.

I as a black person, am exhausted and mentally drained from all this so there is nobody on this earth who will ‘force’ me to speak. 

I even felt to deactivate as I’d rather be ignorant to it all and if anybody else has I wouldn’t blame them. This is painful Maia.

